// HadithQueryResults.js
import React from 'react';
import { useLocation } from 'react-router-dom';
import './HadithQueryResults.css';

const HadithQueryResults = () => {
  const location = useLocation();
  const { resultsData } = location.state;

  return (
    <div className="hadith-query-results">
      <div className="back-button-HQR" onClick={() => window.history.back()}>
        <img src={require('../../assets/back_button.png')} alt="Back Button" />
      </div>
      <div className="query-text-box">Query Text console.log(typeof resultsData);</div>

      {resultsData.map((data, index) => (
        <div key={index} className="details-table">
          <h2>Table {index + 1}</h2>
          <table>
            <tbody>
              <tr>
                <th>Hadith Number</th>
                <th>Theme</th>
                <th>Text</th>
              </tr>
              {data.map((item, i) => (
                <tr key={i}>
                  <td>{item.HadithNo}</td>
                  <td>{item.Theme}</td>
                  <td>{item.Text}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
};

export default HadithQueryResults;
